import {VictoryPie} from 'victory';
function ShowProgress(){

    const sampleData = [{ x: "Cats", y: 35 },
        { x: "Dogs", y: 40 },
        { x: "Birds", y: 55 }
    ];
return(
    <div className="container" style={{height:100, width: 200}}>
        <VictoryPie
            colorScale={["tomato", "orange", "navy" ]}
            data={sampleData}
        />
    </div>
);    
}

export default ShowProgress;
